from django.test import Client
from django.urls import reverse
from rest_framework.test import APITestCase
import json

data = {"url": "data:image/jpeg;base64,"}

answer = "Photo Accepted"

class Test_moderator_api_call(APITestCase):
    """
    This test will send a post request to the end point "all_sightings". This endpoint must return the Response status code of 200.
    """

    def test_002_moderator_api_call(self):
        
        client = Client()
        sign_up_response = client.post(
            reverse("signup"),
            data={"email": "test@test.com", "password": "test", "display_name": "DUMMY"},
            content_type="application/json",
        )
        response_body = json.loads(sign_up_response.content)
        self.client.credentials(HTTP_AUTHORIZATION=f"Token {response_body['token']}")
        response = self.client.post(reverse("moderate_image"), data=data)
        with self.subTest():
            self.assertEqual(response.status_code, 200)
        self.assertEqual(json.loads(response.content), answer)
